const Jobs = ({ data }) => {

    // console.log("Jobs dataL:", data)

    return (
        <>
            <div>Search Result:</div>
            {
                data && data.data.map(info => {
                    <ul key={info._id}>
                        <li>Job Title: {info.title}</li>
                        <li>Category: {info.category}</li>
                        <li>Company:{info.company_name}</li>

                    </ul>
                })
            }
        </>

    )
}

export default Jobs
